    false,nt"url": null,nt"notes": "This Hunting Chapter precedes the overall
    Visitor Services Plan for Agassiz National Wildlife Refuge (Agassiz NWR). This chapter
    includes specific guidelines for expanding hunting opportunities on the refuge as
    described and approved in the Agassiz National Wildlife Refuge Comprehensive Conservation
    Plan (CCP), which was approved July 19, 2005. Through the CCP process an Environmental
    Assessment, Compatibility Determination for Hunting (Appendix A) and public reviews
    were accomplished. Expanding hunting opportunities on the Agassiz NWR are supported
    in the 1997 National Wildlife Refuge Improvement Act as one of the six priority
    public uses encouraged on refuges. The Section 7 Consultation is attached.",nt"license_title":
